/* 
Component - Imports train and test dataset (.csv)
Functionality
- takes train data and test data as input (.csv)
- preprocess the data
- stores the preprocessed file in backend
- */

import React, { useState } from 'react';
import axios from 'axios';
import './ImportCSV.css';
import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';
import BarChart from './ChartComponent';


function ImportCSV() {
  const [trainData, setTrainData] = useState(null);
  const [trainingSize, setTrainingSize] = useState(0.8); 
  const [train_data_graph, settrain_data_graph] = useState(null);
  const [train_data_RowCount, settrain_data_RowCount] = useState(null);
  const [train_data_ColCount, settrain_data_ColCount] = useState(null);
  const [graphTarget, setGraphTarget] = useState(null);


  const [testData, setTestData] = useState(null);
  const [test_data_graph, settest_data_graph] = useState(null);
  const [test_data_RowCount, settest_data_RowCount] = useState(null);
  const [test_data_ColCount, settest_data_ColCount] = useState(null);


  const handleTrainDataUpload = (event) => {
    setTrainData(event.target.files[0]);
  };

  const handleTrainingSizeChange = (value) => {
    setTrainingSize(value);
  };
  const handleTestDataUpload = (event) => {
    setTestData(event.target.files[0]);
  };

  const handleGraphUpload = () => {
    const formData = new FormData();
    formData.append('file', trainData);

    axios
      .post('/upload/train_data', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          settrain_data_graph(response.data.graph_url);
          settrain_data_RowCount(response.data.rows);
          settrain_data_ColCount(response.data.columns);
          setTrainData(response.data.csv_data);
          setGraphTarget(response.data.target);




        }
      })
      .catch((error) => {
        console.error(error);

      });
  };

  const handleCountUpload = () => {
    const formData = new FormData();
    formData.append('file', testData);

    axios
      .post('/upload/test_data', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          settest_data_graph(response.data.graph_url);
          settest_data_RowCount(response.data.rows);
          settest_data_ColCount(response.data.columns);
        }
      })
      .catch((error) => {
        console.error(error);

      });
  };

  const handlePreprocessData = () => {
    axios
      .post('/preprocess', { trainingSize })
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };



  return (
    <div className="container">
      <div className="section">

{/* Train Data/*/}        
        <h2>Train Data</h2>
        <div className="input-section">
          <input type="file" onChange={handleTrainDataUpload} />
          <button onClick={handleGraphUpload}>Upload</button>
        </div>
        <div className="slider-container">
        <p style={{ fontFamily: 'inherit',fontSize: '16px' }}>Training Size: {trainingSize}</p>
          <Slider
            min={0.1}
            max={1}
            step={0.1}
            value={trainingSize}
            onChange={handleTrainingSizeChange}/>
        </div>
        {train_data_graph && (
          <div className="result">
            <img src={train_data_graph} alt="Graph" />
            <p>Data Rows: {train_data_RowCount}</p>
            <p>Data Columns: {train_data_ColCount}</p>
            <p>Target Variable : {graphTarget}</p>
          </div>
        )}
        <BarChart/>
      </div>

{/* Test Data/*/}
      <div className="section">
        <h2>Test Data</h2>
        <div className="input-section">
          <input type="file" onChange={handleTestDataUpload} />
          <button onClick={handleCountUpload}>Upload</button>
        </div>
        {test_data_RowCount !== null && test_data_ColCount !== null && (
          <div className="result">
            <img src={test_data_graph} alt="Graph" />
            <p>Data Rows: {test_data_RowCount}</p>
            <p>Data Columns: {test_data_ColCount}</p>
          </div>
        )}
      </div>

      <button
        style={{ fontSize: '14px',  
                  background:'#ffb347' , 
                  width:'120px', 
                  height:'50px',
                  position: 'fixed',
                  bottom: '20px',
                  left: '20px',
                  marginTop: '45px',
                  cursor: 'pointer',
                  borderRadius: '8px',
                  border: 'none',
                  color: 'white',}}
        onMouseEnter={(e) => {
          e.target.style.backgroundColor = 'lightgrey';
          e.target.style.color = 'white';
          e.target.style.borderRadius = '8px';
        }}
        onMouseLeave={(e) => {
          e.target.style.backgroundColor = '#ffb347';
          e.target.style.color = 'white';
          e.target.style.borderRadius = '8px';
        }}
        onClick={handlePreprocessData}
      >
        Preprocess Data
      </button>

    </div>
  );
}

export default ImportCSV;
